const ItemsPage = () => {
  return (
    <React.Fragment>
      <Grid container spacing={0} justify="center">
        <Grid item md={1}></Grid>
        <Grid item md={4}>
          <ImageCarousel />
        </Grid>
        <Grid item md={6}>
          <ItemDescription />
        </Grid>
        <Grid item md={1}></Grid>
        {/* <Grid item md={2}>
          <MapAndContact />
        </Grid> */}
      </Grid>
    </React.Fragment>
  );
};

export default ItemsPage;
